import { IS_MOVIE_IMAGE_LOADED, IS_TV_IMAGE_LOADED, IS_PERSON_IMAGE_LOADED } from './types'


export const ImageLoading = ( mediaType, Location, loaded ) => {  
console.log(mediaType)
console.log(Location)
console.log(loaded)

    return (dispatch) => {
        switch (mediaType) {
            case 'movie':
                dispatch({
                        type: IS_MOVIE_IMAGE_LOADED,
                        index: Location,
                        payload: loaded
                    })
                break;

            case 'tv':
                dispatch({
                        type: IS_TV_IMAGE_LOADED,
                        index: Location,
                        payload: loaded
                    })
                break;

            case 'person':
                dispatch({
                    type: IS_PERSON_IMAGE_LOADED,
                    index: Location,
                    payload: loaded
                })
                break;

            default:
                break;
        }
    };
};
